wa hingga saat ini belum terdapat aturan spesifik yang mengatur penyalahgunaan AI berupa deepfake.\n\nHowever, selain tercermin dalam UU PDP, ada juga loh peraturan perundang-undangan lainnya yang mengatur tentang deepfake, yaitu UU ITE dan perubahannya, UU Pornografi, KUHP, dan UU 1/2023 tentang KUHP baru.','2024-01-20 07:06:00+00:00','netral\r'),(11804,'klinikhukum','https://twitter.com/klinikhukum/status/1748602017843667161','Next, menurut penelusuran mimin, ketentuan deepfake terdapat dalam Pasal 66 UU PDP, yaitu setiap orang dilarang membuat data pribadi palsu atau memalsukan data pribadi dengan maksud untuk menguntungkan diri sendiri atau orang lain yang dapat mengakibatkan kerugian bagi orang lain.','2024-01-20 07:03:03+00:00','netral\r'),(11805,'klinikhukum','https://twitter.com/klinikhukum/status/1748601793997848969','As explained before, teknologi deepfake digunakan untuk merekayasa gambar atau video menggunakan wajah orang lain dalam pembuatannya. Sebagai informasi, menurut Pasal 4 ayat (2) huruf b UU PDP dan penjelasannya, gambar wajah termasuk dalam data biometrik yang bersifat spesifik.','2024-01-20 07:02:09+00:00','netral\r'),(11806,'klinikhukum','https://twitter.com/klinikhukum/status/1748601478695223671','So, apa jerat hukum yang dapat dikenakan terhadap pelaku pembuat deepfake AI?','2024-01-20 07:00:54+00:00','netral\r'),(11807,'klinikhukum','https://twitter.com/klinikhukum/status/1748601238680424769','Next, selain dalam bentuk video, teknologi deepfake juga dapat digunakan untuk merekayasa gambar.','2024-01-20 06:59:57+00:00','netral\r'),(11808,'klinikhukum','https://twitter.com/klinikhukum/status/1748601135227879800','Deepfake juga merupakan istilah yang diberikan pada algoritma, dimana algoritma tersebut memungkinkan penggunanya untuk mengubah wajah dari satu aktor menjadi wajah dari aktor lain dalam video yang berbentuk photorealistic, yaitu meniru objek visual yang nyata.','2024-01-20 06:59:32+00:00','netral\r'),(11811,'klinikhukum','https://twitter.com/klinikhukum/status/1748600211067523454','Sebelum kita kupas tuntas tentang jerat hukum bagi pelaku pembuat deepfake AI, ikuti polling berikut yuk!','2024-01-20 06:55:52+00:00','netral\r'),(11812,'klinikhukum','https://twitter.com/klinikhukum/status/1748600143681818654','Hi Follawers! Kamu pasti tahu dong, belakangan ini, medsos kembali digemparkan dengan beredarnya video influencer yang jadi korban deepfake artificial intelligence (AI) untuk mempromosikan judi online.\n\nMenurut berita yang beredar, video di medsos yang menampilkan diskusi di televisi antara jurnalis Najwa Shihab dengan selebriti Raffi Ahmad dan Atta Halilintar soal promosi situs judi online yang viral dipastikan hoaks.\n\nLantas, apa jerat hukum yang dapat dikenakan terhadap pelaku pembuat deepfake AI?\n\nSimak ulasannya lewat thread berikut yaa!\n\n[A THREAD]','2024-01-20 06:55:36+00:00','negatif\r'),(11813,'ashelasalsa','https://twitter.com/ashelasalsa/status/1748586963173613738','@j8minjeong Tppp Itu deepfake ai bang ?','2024-01-20 06:03:13+00:00','netral\r'),(11814,'talkwithrajeev','https://twitter.com/talkwithrajeev/status/1748583415648338016','Sir, yahan 2 alag cheezein hai.\n1. Content delivery ko rokna kaafi mushkil hai. VPN jaisi services ka aasani se available hona isey kaafi jatil banata hai.\n2. Deepfake ko kaafi had tak roka jaa sakta hai. Deepfake AI ki madad se generate hote hein, in AI Applications, inke Models, generate hote samay hi ek data mark Daal de ki yeh AI generated hai.. to baaki sab jagah chahey Social Media ho yaah koi aur platform uneeh aisey content ko pehchanna aasan hoga. Kaafi platforms ne issey apnanana chalu bhi Kar diya hai.\n\nPhir bhi is duniya mein jahan secured inventions ke pehley unhey Bypass karna ke madhyam uplabdh ho...to ? pratishat rok lagana mushkil hai... Manual Intervention, Law ka intervention behad zaroori hai.','2024-01-20 05:49:08+00:00','positif\r'),(11815,'mikha_david','https://twitter.com/mikha_david/status/1748554244477898810','@n