nyak gc yg isinya pedo terus share video kaya gitu. Belum lagi ada deep fake juga. Pelaku jaman sekarang pinter, tapi kita harus lebih pinter','2024-03-06 12:11:41+00:00','negatif\r'),(12448,'qaedif','https://twitter.com/qaedif/status/1765322974520062156','Tinggal tunggu waktu juga data face detection bocor. Bisa dianu anuin deh muka kita nanti pake deep fake','2024-03-06 10:26:09+00:00','negatif\r'),(12449,'jalur5_','https://twitter.com/jalur5_/status/1765015654430859447','Seorang pemuda bernama Addril (22) nekat membobol saldo kartu multi trip (KMT) commuter line (KRL) milik PT Kereta Api Indonesia (KAI).\n\nPelaku berhasil menyusup ke dalam situs keuangan PT KAI secara otodidak setelah melihat tayangan YouTube.\n\nBermodalkan ponsel, pelaku hanya membutuhkan waktu 2 hari untuk melancarkan aksinya.\n\nAdapun modus pelaku adalah dengan cara mengisi saldo KMT menggunakan aplikasi C-Access dan HttpCanary dengan metode pembayaran melalui GoPay.\n\n\"Jadi, dia (tersangka) ini mengubah sistem aplikasi C-Access sehingga pembayaran atau tagihan administrasi hanya Rp 1 (satu rupiah) setiap top up. Nah pelaku ini mendapatkan saldo top up sebesar Rp12.414.998 dari 25 kali top up dengan pembayaran Rp 25 perak,\" kata Kapolres Metro Depok, Kombes Arya Perdana kepada wartawan, Senin (4/3).\n\nKasus ini terungkap setelah PT KAI curiga dengan kejanggalan sistem transaksi dalam sistem keuangan mereka.\n\n\"Ini awalnya laporan PT KAI yang melihat kok saldonya tidak sesuai dengan apa yang diisikan, ada ketidak cocokan. Jadi mereka punya satu sistem yang melihat ada transaksi yang mencurigakan dalam data pengisian atau top up,\" katanya.\n\nSementara itu, Addril mengaku dirinya baru kali ini melakukan aksi peretasan. Ia berdalih melakukan aksinya karena iseng.\n\n\"Saya ini pencinta kereta, iseng aja, lagi pingin naik kereta biar gratis,\" katanya.\n\nAddril juga mengaku, dirinya aktif mengunggah video tentang kereta di TikTok.\n\nMeski begitu, Ia membantah jika dirinya menjual sederet KMT yang telah Ia retas tersebut.\n\n\"Nggak, nggak ada yang saya jual. Ini cuma buat pribadi aja,\" katanya. \n\nSumber : https://t.co/ciSuMbHkr6','2024-03-05 14:04:59+00:00','positif\r'),(12450,'RicKY_KCh','https://twitter.com/RicKY_KCh/status/1765275065103372779','Deepfake lebih meyakinkan dari sebelumnya.\nEra penyebaran berita bohong, Fitnah, dan kejahatan semakin mengkhawatirkan.\nSemoga kita semua dijauhkan dari kejahatan itu ? https://t.co/3PT8e3BG3Q','2024-03-06 07:15:47+00:00','netral\r'),(12451,'RicKY_KCh','https://twitter.com/RicKY_KCh/status/1319051762007855104','Kita masuk di era dimana musuh bisa dibuat mirip siapapun, berkata apapun , dan kapanpun.Sekalipun mereka tidak pernah berkata seperti itu.\nTeknologi ini dinamakan Deep Fake yg semakin banyak memakan korban.\nWaspadalah ! https://t.co/7dds8BQZeA','2020-10-21 23:03:41+00:00','negatif\r'),(12452,'Cobrakai_1','https://twitter.com/Cobrakai_1/status/1765238489736687712','@rohini_sgh MP ji abhi deepfake aur AI bolenge.. chatgpt , Gemini, sora se lekar sab blame ho jaega! \n\nBas jab electoral bonds ki baat krenge toh 1950s ki technology ki baat krenge ki ismei time lgta h..daakiya Babu se patrika kho gyi...dial up connection h ji SBI ka toh!','2024-03-06 04:50:27+00:00','netral\r'),(12453,'Vinodh_VNB','https://twitter.com/Vinodh_VNB/status/1765221831383130302','Areyyy @DrKSVarma quality expert cum journalist sunta voice morph chesina deep fake video ani thelusoleni nuvu journalism Em chesav ra\nNote : \nnenu ee buli gadi ki  fan yem khadhu casual Ga chusina nakey ardhamyndhi\nProfile lo qualityanalyst ani petukuna ediki thelidha ani doubt','2024-03-06 03:44:15+00:00','negatif\r'),(12454,'cukomeong','https://twitter.com/cukomeong/status/1765189767984259561','@ARSIPAJA Pdhl konten digital itu rentan manipulasi apalagi dgn teknologi skrg. Yg evil editing, deep fake AI, video cuma sepotong-sepotong yg gampang bgt dibelokin.','2024-03-06 01:36:50+00:00','negatif\r'),(12456,'zakshari','https://twitter.