he Royal Family recently got busted releasing an AI photo of Kate with her children. It was only noticeable because there were numerous people in the frame. \n\nAdditionally, if the person is too close, you will see imperfections. So farther away is better when it comes to deepfakes.\n— case in point, the cancer announcement video shows a distorted left nostril when she tilts her head or has a sudden movement.\n\nFINAL THOUGHTS:\nIt’s pretty much conclusive for me.. Kate Middletons cancer Announcement video is an AI Deepfake. \n\nSo if this was a deepfake, what REALLY happened to Kate Middleton?\n\nHow long until we hear those words… “things took a turn for the worst”?\n\nOR……\nMaybe it’s just her favorite lucky shirt and I’m overthinking it? ? \n\nI’m sure all wealthy members of the Royal Family have a random favorite shirt they’ve kept for 8 years.\n\nhttps://t.co/2g26WRt9rt','2024-03-25 00:55:51+00:00','positif\r'),(12545,'amymaymacc','https://twitter.com/amymaymacc/status/1772160651802079434','@aidilsairudin entah bodoh mana amik gambar aku lepastu deepfake kat vid pompuan masturbate, saklahnya dia ada post gambar budak mk lain juga mat.','2024-03-25 07:16:39+00:00','netral\r'),(12546,'_TaNoLii','https://twitter.com/_TaNoLii/status/1772155343935578405','@Lostsoul_iQu @iffiViews ???? deep fake tu gandi he bnti hain, etna bara khandan hy kia izat reh jati','2024-03-25 06:55:33+00:00','negatif\r'),(12547,'padhlepleaseRJ','https://twitter.com/padhlepleaseRJ/status/1772149535894040793','Kya dimaag ho gaya hai deepak ko deepfake padh dia','2024-03-25 06:32:28+00:00','netral\r'),(12548,'mumtaz_chd','https://twitter.com/mumtaz_chd/status/1772130148621455437','@MR_CooL77777 Police bol degassing deep fake video hai IA se banaya hai ?','2024-03-25 05:15:26+00:00','negatif\r'),(12549,'iamsky2684','https://twitter.com/iamsky2684/status/1772084809453404457','@StyleListings Ab kya karein\nOriginal kon sa h aur deepfake kon sa ye bhi PTA nhi chala\nAI is a danger','2024-03-25 0